import React, { Component } from 'react';


class Wikepedia extends Component {

    constructor(props) {
      super(props)
    
      this.state = {first:'',
                    second:'',
                    third:'',
                    fourth:''
         
      }
    }
    
    render() {
        return (
            <div>
                <label>Wikipedia Search</label>
                <input type='text' value={this.state.first}  />
            </div>
        );
    }
}

export default Wikipedia;
